import useStoreon from 'storeon/react';
import Layout from '../components/Layout/Layout';
import Header from '../components/Header/Header';
import { initialisation } from '../store/init';
import Footer from '../components/Footer/Footer';
import Description from '../components/Description/Description';
import Description__Header from '../components/Description/Description__Header';


const Contacts = () => {
  const contactsPage = useStoreon('contacts-page')['contacts-page'];

  return (
    <>
      <Layout>
        <Header/>
        <Description
          header={<Description__Header />}
          property="description"
          data={contactsPage && contactsPage}
        />
        <div className="mapWrapper">
          <iframe
            className="map"
            src="https://yandex.ru/map-widget/v1/?um=constructor%3Afb1cdb0b9acfb40ca4aa65daa33e4533d7d554eb61f4bb2a6c92c2987593de3b&amp;source=constructor"
            width="1060"
            height="400"
            frameborder="0">
          </iframe>
        </div>
        <Footer/>
      </Layout>
      <style jsx>{`
        .mapWrapper {
          display: flex;
          justify-content: center;
          margin-top: 2em;
        }

        .mapWrapper .map {
          border: 4px solid var(--accent-color);
        }
      `}</style>
    </>
  )
}

Contacts.getInitialProps = async function(props) {
  const initData = await initialisation(props.store);
  return { initData }
}

export default Contacts;
